    [],nt"revision_timestamp": "2015-04-25T12:20:07.291766",nt"name": "vegetation-fish-slough-ds985",nt"isopen":
    false,nt"url": null,nt"notes": "A fine-scale vegetation classification
    and map of a portion of the Fish Slough Area of Critical Environmental Concern (ACEC)
    (including the California Department of Fish and Wildlife (CDFW) Fish Slough Ecological
    Reserve) in Inyo and Mono Counties, California, was created by the CDFW Vegetation
    Classification and Mapping Program (VegCAMP). The vegetation classification is derived
    from floristic field survey data collected during September 2011, November 2012
    and June 2013 and is based on previously described Alliances and Associations, with
    a few new provisional types included. The map was produced using heads-up digitizing
    using true-color 2012 1-meter National Agricultural Imagery Program (NAIP) imagery
    as the base. Supplemental imagery included 2012 1-meter NAIP Color Infrared and
    imagery available through Bing Maps and Google Earth. The minimum mapping unit (MMU)
    is 1 acre for upland habitats and u00bc-acre for wetland habitats. Field reconnaissance
    and field verification enhanced map quality. The final map includes a total of 365
    polygons representing 40 vegetation map classes.",nt"license_title": null,nt"extras":
